<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">Tuesday</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;">,</span></span>
